import React, { useEffect, useState } from "react";

export default function ProductList() {
    const [data, setProducts] = useState({ products: [] })
    const result = [{
        id: 1,
        name: 'name',
        price: 'price',
        image: 'image'
    },
    {
        id: 2,
        name: 'name',
        price: 'price',
        image: 'image'
    },
    {
        id: 3,
        name: 'name',
        price: 'price',
        image: 'image'
    }];

    function loadData() {
        setProducts(result)
    }
    useEffect(() => {
        loadData()
        return () => { }
    }, []);

    return (
        <ul>
            {data && data.products && data.products.map(product => (
                <li key={product.id}>
                    <p>{product.name}</p>
                </li>
            ))}
        </ul>
    );
}
